import axios from 'axios';
import { useEffect, useState } from 'react';
const MenuList=()=>{
  //모든 데이터를 담을 변수
  const[Alldata,setAlldata]=useState([]);
  //전체 카테고리와 메뉴를 불러오기
  const allMenu=async()=>{await axios.post('http://127.0.0.1:8000/webKiosk/client/meca/download/',
  {
    "market_name" : "S"
  }).then(
    (response)=>{
      setAlldata(response.data)
    }
  );
}

  if (allMenu===null || allMenu===undefined){
    return(
      <h2>메뉴가 없습니다.</h2>
    )
  }
    return(
    <div className="tableContainer">
    <table className="table">
      <thead>
        <tr id="tre">
          <th className="col">#</th>
          <th className="col">이름</th>
          <th className="col">수량</th>
          <th className="col">판매상태</th>
          <th className="col">###</th>
        </tr>
      </thead>
      <tbody>
      {Object.keys(Alldata).map((item)=>{
          console.log(item)
        return(
        <tr>
          <td>{JSON.stringify(item)}</td>
          <td><button>주문</button></td>
        </tr>
        )
      })}
      </tbody>
    </table>
    {JSON.stringify(Alldata)}

    </div>
        )
    }
  

export default MenuList;
